import NavbarComponent from './Navbar';
import { Container, Row , Col} from 'reactstrap';

const HomeComponent=() => {
    return (
        <>
        <NavbarComponent />
        <div id='bg-image'>
            <Container>
                <Row>
                    <Col md={5}><p id='topic-text'>The Wonderful Trip Planner</p></Col>
                    <Col md={5}><p id='highlight-text'>Adventure</p></Col>
                </Row>
                <Row>
                    
                </Row>

            </Container>
        </div>
        </>
        
    );
}

export default HomeComponent;
